      | 356559 -> { ItemTypeData.id= 356559; name= "Medic - CA"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  A flat-coil e5000 fifth generation fusion core runs up the inside of the back plate, powering the entire suit. Its output and heat buildup are controlled by a L2 “Gatekeeper” regulator conduit, which connects directly to the sensor system at the base of the neck. Every joint is reinforced with kinetic sensors and two-way, high torque servos to enhance the soldier’s strength, balance, and resistance to impact forces. The suit’s helmet has more integrated sensor, communication, targeting, and data processing systems than most civilian vehicles. As is common with Caldari designs, armor plating is limited to vital areas, relying instead on high-power shield systems to protect the wearer.   Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 35683 -> { ItemTypeData.id= 35683; name= "Hecate"; published= true; description= "The first Hecate-class destroyers have entered official service in the Federation Navy on July 7th, YC117 after successful completion of an accelerated proving period. The new ship design has received near-unanimous praise from military experts but a troubled development period has stirred controversy among opposition senators.    President Roden's office has issued a press statement extolling the capabilities of this new vessel:  <i> In these tumultuous times we rely on the brave men and women of the Navy to stand firm against the enemies of our Federation. This administration stands with our armed forces and remains committed to providing these heroes with the best equipment available anywhere in the cluster. The Hecate makes use of the most advanced technology to provide unrivaled flexibility and firepower. Those who would threaten our liberty will learn to fear the strength and resolve of the Federation. </i>    The press release does not address the recent demands from a group of prominent doves in the Senate that the Navy procurement process be subjected to a public inquiry. The administration has previously defended the choice to pour unprecedented amounts of Federal funds into the development of the Hecate through a sole source contract with Roden Shipyards as the only way to retain technological parity with the other empires after the Federation received relatively light support from Capsuleers in their recent research efforts.  -<i>Scope News special report, YC117</i>"; marketGroupId= Some(2034); groupId= 1305; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 3; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1050000.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 1000.000000 }; { DogmaAttributeValueData.attributeId = 1547; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 12; value= 4.000000 }; { DogmaAttributeValu