      | 364028 -> { ItemTypeData.id= 364028; name= "Scout mk.0"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. Augmented joint servo motors give every movement extra speed and flexibility, while integrated friction and impact dampening materials reduce the overall sound signature.  Biotic augments make this suit ideal for a melee-focused role. Woven into the suit, a tremor membrane saturates muscles with nutrients amplifying the cross-sectional force of physical strikes. Combined with rigorous training, this temporarily enhanced strength and dexterity make the Minmatar Scout almost unmatched in hand-to-hand combat.  When missions call for speed and stealth, situations in which heavily armored suits would be more of a burden than an advantage, a scout dropsuit is the best option. The enhanced mobility it provides makes up for its relatively low protection, and when combined with stealth technology modules, the scout suit is the obvious choice for infiltration, counter-espionage, and assassination."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
