      | 365289 -> { ItemTypeData.id= 365289; name= "Pilot G/1-Series"; published= false; description= "The Pilot dropsuit enhances vehicle operability. Using an adaptive synth-nerve network, the suit seamlessly integrates with on-board systems, establishing a cognitive link between the user and the host vehicle. This provides unprecedented control over every aspect of a vehicle’s weapon, navigation, propulsion, and electronic subsystems.    Ill-suited to frontline combat, the Gallente suit instead incorporates a host of structural monitoring nodes, smart I/O channels and energy management controllers into a wearable interface that enhances the performance of the vehicle’s shield and armor subsystems.    In much the same way the capsule revolutionized space flight, the Pilot suit has vastly improved the man-machine interface for planetside vehicles."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
