      | 365580 -> { ItemTypeData.id= 365580; name= "'Shiftrisk' SR-25 Bolt Pistol"; published= false; description= "The result of years of R&D, the bolt pistol is a high-impact handgun capable of firing kinetic projectiles with pinpoint accuracy. Building upon its copious experience with microscale rail weaponry, Kaalakiota has further refined the technology to produce what is commonly regarded as the most powerful handgun on the market.    Central to its success is a smart sensor that bleeds off a minute amount of dropsuit energy at the moment of discharge, dissipating the sharp recoil impulse through the suit’s internal membrane and greatly reducing the peak force of each shot. This seemingly minor innovation is what makes accurate fire of the weapon possible without the need for an external mounting."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365677 -> { ItemTypeData.id= 365677; name= "'Pyrus' ATK-108 Heavy Machine Gun"; published= false; description= "Utilizing sub-licensed technology sourced from all across the cluster, Allotek Industries’ Pyrus product line offers a wide range of dropsuit and weapon variants developed and manufactured in accordance with the corporation’s stringent guidelines to ensure that all products are worthy of carrying the Allotek quality guarantee."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366453 -> { ItemTypeData.id= 366453; name= "Republic MH-82 Heavy Machine Gun"; published= false; description= "A multi-barrel, rotary drive machine gun, the HMG is a singularly devastating anti-infantry weapon. Eschewing the advantages of a lighter frame in favor of stopping power, the exponentially increased heat and vibration produced by this Boundless Creation developed weapon makes it almost unbearable to fire. Yet despite this fact, its above average hit ratio and extreme rate of fire has earned it the nickname “Death's Engine.”  Unlike earlier models, the weapon requires no spool up time; rounds are expelled the instant the trigger is pressed. This comes at the cost of initially reduced accuracy as the counter-rotating drives slowly align. Once fully aligned, however, the HMG produces a pinpoint stream of gunfire with unmatched killing potential."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
